package com.raychenon.leetcode;

import junit.framework.Assert;
import org.junit.BeforeClass;
import org.junit.Test;

import java.util.Arrays;
import java.util.List;

/**
 * User: raychenon
 * Date: 2019-10-03
 * https://leetcode.com/problems/find-all-anagrams-in-a-string
 */
public class FindAllAnagramsInaStringTest {

    private static FindAllAnagramsInaString instance;

    @BeforeClass
    public static void setUp() {
        instance = new FindAllAnagramsInaString();
    }

    @Test
    public void findAnagram_abc_Test() {
        List<Integer> output = Arrays.asList(0, 6);
        Assert.assertEquals(output, instance.findAnagrams("cbaebabacd", "abc"));
    }

    @Test
    public void findAnagram_ab_Test() {
        List<Integer> output = Arrays.asList(0, 1, 2);
        Assert.assertEquals(output, instance.findAnagrams("abab", "ab"));
    }

    @Test
    public void superLonStringTest() {
        List<Integer> output = Arrays.asList(0, 10001);
        Assert.assertEquals(output, instance.findAnagrams(
                "",
                ""));
    }

    @Test
    public void findSameCharTest() {
        List<Integer> output = Arrays.asList(0, 1, 2, 3, 4);
        Assert.assertEquals(output, instance.findAnagrams("aaaaaa", "aa"));
    }

    @Test
    public void findOneCharTest() {
        List<Integer> output = Arrays.asList(1, 3);
        Assert.assertEquals(output, instance.findAnagrams("baca", "a"));
    }
}
